import React, { useState } from 'react';

function Header() {
  const [show, setShow] = useState(false);
	const handleToggle = () => setShow(!show);

	return (
  		<header id="header" className="fixed-top d-flex align-items-center">
				<div className="container d-flex align-items-center justify-content-between">

			      <div className="logo">
			        <h1 className="text-light"><a href="index">Serenity</a></h1>
			        {/*<!-- Uncomment below if you prefer to use an image logo -->
			        <!-- <a href="index"><img src="assets/img/logo.png" alt="" className="img-fluid" /></a>-->*/}
			      </div>

			      <nav id="navbar" className="navbar">
			        <i onClick={handleToggle} className={`bi ${!show ? 'bi-list mobile-nav-toggle' : 'bi-x navbar-mobile'}`}></i>
			      </nav>

				</div>
 			</header>
	)
}

export default Header;
